import React from 'react';
import Card from './Cards';
import Sdata from './Sdata';

const Fav = (val) => {
    if(val.site === "netflix"){
        return (
            <Card  
                key = {val.id}
                imgsrc={val.imgsrc}
                title={val.title}
                sname={val.sname}
                link={val.link}
            />
         );
    }else if(val.site === "amazon"){
        return (
            <Card  
                key = {val.id}
                imgsrc={val.imgsrc}
                title={val.title}
                sname={val.sname}
                link={val.link}
            />
         );
    }else if(val.site === "nettv"){
        return (
            <Card  
                key = {val.id}
                imgsrc={val.imgsrc}
                title={val.title}
                sname={val.sname}
                link={val.link}
            />
         );
    }
}

function FavSeries(){
    return Sdata.map(Fav);
}

export default FavSeries;
